import './App.css';
import Main from './Main/Main';
import 'bootstrap/dist/css/bootstrap.css';
import React from 'react';
import { Container } from 'react-bootstrap';

const App = () => {
  return (
    <Container fluid style={{ minHeight: '100vh' }}>
      <div   className="bg-dark" >
        <Main />
      </div>
    </Container>
  );
};


export default App;
